import React from 'react';
import { GoClock, AiFillStar } from "react-icons/bs";
import { Card, Card_body, Card_image, Divider_line, Card_button, Module_name, Section_container} from '../styles/module.style';



function Modules(props){
    return(
        <>
            <Card>
                 <Card_body>
                     <Card_image src={props.img} />
                     <Divider_line></Divider_line>
                     <div>
                         <Module_name><b>{props.name}</b></Module_name>
                     </div>
                     <div>
                         <p>{props.heading}</p>
                     </div>
                     <Section_container>
                         <div><GoClock/><p>Temps pass√© :</p></div>
                         <div><AiFillStar/><p>score: 0%</p></div>
                     </Section_container>

                    
                     <center><Card_button>Show Unites</Card_button></center>

                 </Card_body>
            </Card>
        </>
    );
}


export default Modules;
